import React from 'react';

const About = () => {
  return (
    <div className="about">
      <h1>About Us</h1>
      <p>We are a company dedicated to providing high-quality products to our customers.</p>
      <p>Our mission is to deliver exceptional products that meet the needs and expectations of our customers.</p>
      <p>For more information, please contact us at info@example.com.</p>
    </div>
  );
};

export default About;
